// src/pages/Sandwiches.js
import React from 'react';

function Sandwiches() {
  return (
    <div>
      <h2>Sandwiches</h2>
      <p>Freshly made sandwiches with a range of tasty fillings to satisfy your hunger.</p>
    </div>
  );
}

export default Sandwiches;
